import { api } from "../utils/AxiosUtil";
import { YMaps, Map } from "@pbe/react-yandex-maps";

export default function Home() {

  const check = () => {
    console.log(123);
    const path = "/api/v1/test-login";

    api
      .get(path)
      .then((data) => {
        console.log(456);
        console.log(data);
      })
      .catch(function (error) {
        console.log(error);
      });
  };
    const [selectedLocation, setSelectedLocation] = useState(null);

    const handleSelectLocation = (coordinates: any) => {
        setSelectedLocation(coordinates);
    };


  return (
      <div className="bg-gradient-to-r from-pink-100 via-purple-100 to-gray-100 w-full h-screen font-abel ">
          <input type="text" className="form-control" id="suggest"/>
          <YMaps>
              <Map
                  defaultState={{center: [55.751574, 37.573856], zoom: 9}}
                  modules={["SuggestView"]}
              />
          </YMaps>
      </div>
  );
}

